import React from 'react';
import '../index.css'


class Bottom extends React.Component {
        constructor (props) {
          super(props)

        }
    render(){
        let listData = this.props.list
        return (
            <div>
                <div className="title">{this.props.title}</div>
                <div className="content">
                {
                  listData.map(item => {
                    return (
                      <div key={item.id} className="item"> 
                        <div>{item.title}</div>
                      </div>
                    )
                   })
                }
                </div>
            </div>
        );
    }
}

export default Bottom;
